(1504,'Mr','Priya','James','Khan','1973-08-25','F','0417 574 986','Suite 40 / 819 Victoria St, Parramatta, Brisbane, SA, 2830','priya.khan1504@example.com','Michael Khan','0454 890 262','Priya Khan is a 52-year-old patient presenting with a multifaceted history of chronic and intermittent symptoms affecting daily life. Over recent months, they have reported a variable pattern of discomfort, fluctuating energy levels, and difficulty maintaining concentration. Symptoms appear to worsen during periods of work-related stress, insufficient sleep, or extended sedentary activity, but occasionally improve with rest and structured exercise. The patient describes inconsistent dietary habits influenced by workload and family responsibilities. They deny recent fever, acute illness, or sudden functional decline but note gradual changes that have begun to impact productivity and emotional wellbeing. Past medical history includes minor episodic conditions that have been manageable but periodically interact with current symptoms. Family history suggests potential genetic predispositions, although no formal diagnoses have been confirmed. They aim to better understand symptom patterns, identify contributing lifestyle factors, and develop a sustainable long-term management plan including sleep optimisation, activity pacing, and holistic monitoring.'),
